import React, { useContext } from "react";
import { Link, useHistory } from "react-router-dom";
import dark from "../darkss.svg";
import AuthContext from "../Context/AuthContext";

const Navbar = ({ isAuthenticated }) => {
  const sidebar = () => {
    var elems = document.querySelectorAll(".sidenav");
    window.M.Sidenav.init(elems);
  };

  const auth = useContext(AuthContext);

  const history = useHistory();

  const onLogOut = (e) => {
    auth.logout();
    history.push("/");
  };

  return (
    <React.Fragment>
      <nav className="green darken-1 sticky">
        <div className="nav-wrapper container">
          <a href="/" className="brand-logo" style={{ height: "100%" }}>
            <img
              alt="logo"
              className="logo"
              src={dark}
              style={{ height: "200px", padding: "5px" }}
            />
          </a>
          <a href="/" data-target="mobile-demo" className="sidenav-trigger">
            <i className="material-icons" onClick={sidebar}>
              menu
            </i>
          </a>
          <ul className="right hide-on-med-and-down">
            <li>
              <Link to={isAuthenticated ? "/dashboard" : "/login"}>
                {"  "}
                <i className="fas fa-user mr-1"></i>&nbsp;
                {isAuthenticated ? `Профиль` : "Войти"}
              </Link>
            </li>
            <li>
              <Link to="/basket">
                {" "}
                <i className="fas fa-cart-arrow-down mr-1"></i>Корзина
                <sup>2</sup>
              </Link>
            </li>

            {isAuthenticated && (
              <li>
                <a href="/" onClick={(e) => onLogOut(e)}>
                  {"  "}
                  <i className="fas fa-arrow-right mr-1"></i> Выйти
                </a>
              </li>
            )}
          </ul>
        </div>
      </nav>

      <ul className="sidenav" id="mobile-demo" style={{ zIndex: 1000001 }}>
        <li>
          <Link to={isAuthenticated ? "/dashboard" : "/login"}>
            {"  "}
            <i className="fas fa-user mr-1"></i>{" "}
            {isAuthenticated ? "Профиль" : "Войти"}
          </Link>
        </li>
        <li>
          <Link to="/basket">
            {"  "}
            <i className="fas fa-cart-arrow-down mr-1"></i>Корзина<sup>2</sup>
          </Link>
        </li>

        {isAuthenticated && (
          <li style={{ cursor: "pointer" }} onClick={(e) => onLogOut(e)}>
            <a href="/">
              {"  "}
              <i className="fas fa-arrow-right mr-1"></i>Выйти
            </a>
          </li>
        )}
      </ul>
    </React.Fragment>
  );
};

export default Navbar;
